function FormComponent(props) {
    //const fieldData = useRef(props.fielddata);

    return (
        <div name="Form">
            {
                console.log(props)
            }
            {<form ref={props.form} onSubmit={props.onsubmit}>
                <textarea name="message" hidden />
                <input type="submit" value="Send" />
            </form>}
        </div>
    )
}

export default FormComponent;
